import React from 'react';
import './Footer.css';
import logo from '../assets/frontend_assets/PetShop3.png';
import facebook_icon from '../assets/frontend_assets/facebook.png';
import instagram_icon from '../assets/frontend_assets/instagram.png';
import whatsapp_icon from '../assets/frontend_assets/whatsapp.png';
import waze_icon from '../assets/frontend_assets/waze.png';
import { useNavigate } from 'react-router-dom';

const Footer = () => {
    const navigate = useNavigate();

    const handleNavigation = (path) => {
        navigate(path);
    };

    return (
        <div className='footer'>
            <img src={logo} alt="Pet Shop Logo" />
            <div className='col'>
                <h4>Categories</h4>
                <p onClick={() => handleNavigation("/")}>Shop</p>
                <p onClick={() => handleNavigation("/dog")}>Dogs products</p>
                <p onClick={() => handleNavigation("/cat")}>Cats products</p>
                <p onClick={() => handleNavigation("/bird")}>Birds products</p>
                <p onClick={() => handleNavigation("/discounts")}>Products on Discount</p>
            </div>
            <div className='col'>
                <h4>Information</h4>
                <p onClick={() => handleNavigation("/about-us")}>About us</p>
                <p onClick={() => handleNavigation("/contact-us")}>Contact us</p>
                <p onClick={() => handleNavigation("/delivery-info")}>Delivery information</p>
                <p onClick={() => handleNavigation("/regulations")}>Website Regulations</p>
            </div>
            <div className="col">
                <div className="text">
                    <h4>יציר קשר</h4>
                    <p><strong> כתובת: </strong> סולטאני, כפר קאסם</p>
                    <p><strong> טלפון: </strong>0543395113</p>
                    <p><strong> שעות פתיחה: </strong>11:00 - 23:00</p>
                </div>
                <div className="socials">
                    <h4>עקבו אחרינו</h4>
                    <a href="#"><img src={facebook_icon} alt="Facebook" /></a>
                    <a href="#"><img src={instagram_icon} alt="Instagram" /></a>
                    <a href="#"><img src={whatsapp_icon} alt="WhatsApp" /></a>
                    <a href="#"><img src={waze_icon} alt="Waze" /></a>
                </div>
            </div>
            <div className="cpyright">
                <p>© 2024, Olam Hahaiot - Sabea </p>
            </div>
        </div>
    );
};

export default Footer;
